// action creators
import { ADD_EVENT, CHANGE_SEARCH_TEXT } from "./types";


export function createEvent(event) {
  return { type: ADD_EVENT, payload: event };
}


export function changeSearchText(value) {
  return { type: "CHANGE_SEARCH_TEXT", value: value };
}
